import { useState } from 'react';
import './App.css';
import EmployeeList from './components/employeeList/EmployeeList';
import { data } from './data';

liste = [1,2,3,4,5,6,7]

function App() {
  const [list, setList] = useState(data)
  //burada yani App.js'de tanımlı "liste"'yi EmployeeList içine movedlist adı altında göndermiş oluyoruz ve EmployeeList aslında buradaki "liste'ye" movedlist şeklinde erişebiliyor.
  // 2. olan employees={list} ataması ise yukarıdaki 
  return(<div>
    <EmployeeList movedlist={liste} employees={list} changedList={setList}/>
    <p>{data.length}</p>
  </div>)
}

export default App;
